import React from "react";
import { MainMenuButton } from "./MainMenuButton";

const MainMenu = (props) => {


    return(
        <React.Fragment>
            < MainMenuButton buttonText="Yeah" />
            < MainMenuButton buttonText="Dva" />
            < MainMenuButton buttonText="Tri" />
        </React.Fragment>
    )
}

export { MainMenu };
